import React from 'react';
import {useParams} from 'react-router-dom';

// const User = ({match}) => {
//     return <h1>{match.params.fname} Page</h1>
// }

const User = () => {
    const {name, nam} = useParams();
    return <h1>{name} {nam} Page</h1>
}

export default User;
